// Handles n chunks of N_PACKED_INSTANCES blake2s instances.
func _finalize_blake2s_inner{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, blake2s_ptr: felt*}(
    n: felt, sigma: felt*
) {
    if (n == 0) {
        return ();
    }

    alloc_locals;
    let blake2s_start = blake2s_ptr;

    // Load instance data.
    let (local data: felt*) = alloc();
    _pack_ints(INSTANCE_SIZE, data);

    let input_state: felt* = data;
    let message: felt* = input_state + STATE_SIZE_FELTS;
    let t0_and_f0: felt* = message + INPUT_BLOCK_FELTS;
    let output_state: felt* = t0_and_f0 + 2;

    // Run blake2s on N_PACKED_INSTANCES instances.
    blake2s_compress(
        h=input_state,
        message=message,
        t0=t0_and_f0[0],
        f0=t0_and_f0[1],
        sigma=sigma,
        output=output_state,
    );
    let blake2s_ptr = blake2s_start + INSTANCE_SIZE * N_PACKED_INSTANCES;

    return _finalize_blake2s_inner(n=n - 1, sigma=sigma);
}

// Given N_PACKED_INSTANCES sets of m (32-bit) integers in the blake2s implicit argument,
// where each set starts at offset INSTANCE_SIZE from the previous set,
// computes m packed integers.
// blake2s_ptr is advanced m steps (just after the first set).
func _pack_ints{range_check_ptr, blake2s_ptr: felt*}(m, packed_values: felt*) {
    static_assert N_PACKED_INSTANCES == 7;
    alloc_locals;

    local MAX_VALUE = 2 ** 32 - 1;

    tempvar packed_values = packed_values;
    tempvar blake2s_ptr = blake2s_ptr;
    tempvar range_check_ptr = range_check_ptr;
    tempvar m = m;

    loop:
    tempvar x0 = blake2s_ptr[0 * INSTANCE_SIZE];
    assert [range_check_ptr + 0] = x0;
    assert [range_check_ptr + 1] = MAX_VALUE - x0;
    tempvar x1 = blake2s_ptr[1 * INSTANCE_SIZE];
    assert [range_check_ptr + 2] = x1;
    assert [range_check_ptr + 3] = MAX_VALUE - x1;
    tempvar x2 = blake2s_ptr[2 * INSTANCE_SIZE];
    assert [range_check_ptr + 4] = x2;
    assert [range_check_ptr + 5] = MAX_VALUE - x2;
    tempvar x3 = blake2s_ptr[3 * INSTANCE_SIZE];
    assert [range_check_ptr + 6] = x3;
    assert [range_check_ptr + 7] = MAX_VALUE - x3;
    tempvar x4 = blake2s_ptr[4 * INSTANCE_SIZE];
    assert [range_check_ptr + 8] = x4;
    assert [range_check_ptr + 9] = MAX_VALUE - x4;
    tempvar x5 = blake2s_ptr[5 * INSTANCE_SIZE];
    assert [range_check_ptr + 10] = x5;
    assert [range_check_ptr + 11] = MAX_VALUE - x5;
    tempvar x6 = blake2s_ptr[6 * INSTANCE_SIZE];
    assert [range_check_ptr + 12] = x6;
    assert [range_check_ptr + 13] = MAX_VALUE - x6;
    assert packed_values[0] = (
        x0 +
        2 ** 35 * x1 +
        2 ** (35 * 2) * x2 +
        2 ** (35 * 3) * x3 +
        2 ** (35 * 4) * x4 +
        2 ** (35 * 5) * x5 +
        2 ** (35 * 6) * x6
    );

    tempvar packed_values = packed_values + 1;
    tempvar blake2s_ptr = blake2s_ptr + 1;
    tempvar range_check_ptr = range_check_ptr + 14;
    tempvar m = m - 1;
    jmp loop if m != 0;

    return ();
}

// Helper functions.
// These functions serialize data to a data array to be used with blake2s().
// They use the property that each data word is verified by blake2s() to be in range [0, 2 ** 32).

// Serializes a uint256 number in a blake2s compatible way (little-endian).
func blake2s_add_uint256{data: felt*}(num: Uint256) {
    let high = num.high;
    let low = num.low;
    %{
        B = 32
        MASK = 2 ** 32 - 1
        segments.write_arg(ids.data, [(ids.low >> (B * i)) & MASK for i in range(4)])
        segments.write_arg(ids.data + 4, [(ids.high >> (B * i)) & MASK for i in range(4)])
    %}
    assert data[3] * 2 ** 96 + data[2] * 2 ** 64 + data[1] * 2 ** 32 + data[0] = low;
    assert data[7] * 2 ** 96 + data[6] * 2 ** 64 + data[5] * 2 ** 32 + data[4] = high;
    let data = data + 8;
    return ();
}

// Serializes a uint256 number in a blake2s compatible way (big-endian).
func blake2s_add_uint256_bigend{bitwise_ptr: BitwiseBuiltin*, data: felt*}(num: Uint256) {
    // Reverse byte endianness of 32-bit chunks.
    tempvar value = num.high;
    assert bitwise_ptr[0].x = value;
    assert bitwise_ptr[0].y = 0x00ff00ff00ff00ff00ff00ff00ff00ff;
    tempvar value = value + (2 ** 16 - 1) * bitwise_ptr[0].x_and_y;
    assert bitwise_ptr[1].x = value;
    assert bitwise_ptr[1].y = 0x00ffff0000ffff0000ffff0000ffff00;
    tempvar value = value + (2 ** 32 - 1) * bitwise_ptr[1].x_and_y;
    tempvar high = value / 2 ** (8 + 16);

    tempvar value = num.low;
    assert bitwise_ptr[2].x = value;
    assert bitwise_ptr[2].y = 0x00ff00ff00ff00ff00ff00ff00ff00ff;
    tempvar value = value + (2 ** 16 - 1) * bitwise_ptr[2].x_and_y;
    assert bitwise_ptr[3].x = value;
    assert bitwise_ptr[3].y = 0x00ffff0000ffff0000ffff0000ffff00;
    tempvar value = value + (2 ** 32 - 1) * bitwise_ptr[3].x_and_y;
    tempvar low = value / 2 ** (8 + 16);

    let bitwise_ptr = bitwise_ptr + 4 * BitwiseBuiltin.SIZE;

    %{
        B = 32
        MASK = 2 ** 32 - 1
        segments.write_arg(ids.data, [(ids.high >> (B * (3 - i))) & MASK for i in range(4)])
        segments.write_arg(ids.data + 4, [(ids.low >> (B * (3 - i))) & MASK for i in range(4)])
    %}

    assert data[0] * 2 ** 96 + data[1] * 2 ** 64 + data[2] * 2 ** 32 + data[3] = high;
    assert data[4] * 2 ** 96 + data[5] * 2 ** 64 + data[6] * 2 ** 32 + data[7] = low;
    let data = data + 8;
    return ();
}

// Serializes a field element in a blake2s compatible way.
func blake2s_add_felt{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, data: felt*}(
    num: felt, bigend: felt
) {
    let (high, low) = split_felt(num);
    if (bigend != 0) {
        blake2s_add_uint256_bigend(Uint256(low=low, high=high));
        return ();
    } else {
        blake2s_add_uint256(Uint256(low=low, high=high));
        return ();
    }
}

// Serializes multiple field elements in a blake2s compatible way.
// Note: This function does not serialize the number of elements. If desired, this is the caller's
// responsibility.
func blake2s_add_felts{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, data: felt*}(
    n_elements: felt, elements: felt*, bigend: felt
) -> () {
    if (n_elements == 0) {
        return ();
    }
    blake2s_add_felt(num=elements[0], bigend=bigend);
    return blake2s_add_felts(n_elements=n_elements - 1, elements=&elements[1], bigend=bigend);
}

// Computes the blake2s hash for multiple field elements.
func blake2s_felts{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, blake2s_ptr: felt*}(
    n_elements: felt, elements: felt*, bigend: felt
) -> (res: Uint256) {
    alloc_locals;
    let (data) = alloc();
    let data_start = data;
    with data {
        blake2s_add_felts(n_elements=n_elements, elements=elements, bigend=bigend);
    }
    let (res) = blake2s(data=data_start, n_bytes=n_elements * 32);
    return (res=res);
}

// Takes an array of `packed_values_len` felt252s at `packed_values` and encodes them into an array
// of u32s at `unpacked_u32s` in the following way:
//  * If a felt is less than 2^63, it's unpacked to 2 felts, each representing 32 bits.
//  * Otherwise, it's unpacked into 8 felts, each under 2^32, where the most significant
//    limb has its MSB set (Note that the prime is less than 2^255 so the MSB could not be
//    set prior to this intervention).
// All 32-bit limbs are arranged in big-endian order.
// Returns the size of the unpacked array in felts.
// Assumes:
//  * All output felts in `upnacked_u32s` are externally verified to be in [0, 2^32).
// Note: A malicious prover may choose a non-canonical encoding, that is:
//       A felt x can be encoded as any u256 value congruent to x modulo PRIME,
//       and for x < 2^63, the encoding may use either 2 u32s or 8 u32s.
// TODO(alont): Consider adding cases for 1 u32 (small immediates, including negatives)
//      and 3 u32s (extended opcodes).
// TODO(alont): Consider unrolling this loop to avoid state copy overhead.
func encode_felt252s_to_u32s{range_check_ptr: felt}(
    packed_values_len: felt, packed_values: felt*, unpacked_u32s: felt*
) -> felt {
    alloc_locals;

    local EXP31 = 2 ** 31;
    local end: felt* = &packed_values[packed_values_len];

    %{
        offset = 0
        for i in range(ids.packed_values_len):
            val = (memory[ids.packed_values + i] % PRIME)
            val_len = 2 if val < 2**63 else 8
            if val_len == 8:
                val += 2**255
            for i in range(val_len - 1, -1, -1):
                val, memory[ids.unpacked_u32s + offset + i] = divmod(val, 2**32)
            assert val == 0
            offset += val_len
    %}
    local limb_shift = 2 ** 32;
    tempvar out = unpacked_u32s;
    tempvar packed_values = packed_values;
    tempvar range_check_ptr = range_check_ptr;

    loop:
    // Guess if number is small or big.
    if (nondet %{ (ids.end != ids.packed_values) and (memory[ids.packed_values] < 2**63) %} != 0) {
        // Unpack small felt.

        tempvar current_val = packed_values[0];
        tempvar out_0 = out[0];
        // Assert that the limbs represent the number.
        assert current_val = out[1] + 2 ** 32 * out_0;
        // Assert that out0 is in the range [0, 2 ** 31).
        // This ensures that current_val is in the range [0, 2 ** 63).
        assert [range_check_ptr] = out_0 + (2 ** 128 - 2 ** 31);

        tempvar out = &out[2];
        tempvar packed_values = &packed_values[1];
        tempvar range_check_ptr = range_check_ptr + 1;
        jmp loop;
    }

    if (end == packed_values) {
        return out - unpacked_u32s;
    }

    // Handle big felt.
    // Assert that the top limb is over 2^31, as its MSB is artificially set for encoding.
    tempvar raw_out_0 = out[0] - EXP31;
    assert [range_check_ptr] = raw_out_0;
    // Assert that the limbs represent the number, after reverting the MSB of the most significant
    // limb to 0.
    tempvar curr_packed_value = raw_out_0 * limb_shift + out[1];
    tempvar curr_packed_value = curr_packed_value * limb_shift + out[2];
    tempvar curr_packed_value = curr_packed_value * limb_shift + out[3];
    tempvar curr_packed_value = curr_packed_value * limb_shift + out[4];
    tempvar curr_packed_value = curr_packed_value * limb_shift + out[5];
    tempvar curr_packed_value = curr_packed_value * limb_shift + out[6];
    assert packed_values[0] = curr_packed_value * limb_shift + out[7];

    tempvar out = &out[8];
    tempvar packed_values = &packed_values[1];
    tempvar range_check_ptr = range_check_ptr + 1;
    jmp loop;
}

// Computes blake2s of `input` of size `len` felts, representing 32 bits each.
func blake_with_opcode{range_check_ptr}(len: felt, data: felt*, out: felt*) {
    const OP1_AP = 4;
    const BLAKE2S_OPCODE_EXT = 1;
    const BLAKE2S_FINALIZE_OPCODE_EXT = 2;
    const BLAKE2S_AP_FLAGS = OP1_AP * (2 ** 2);
    const BLAKE2S_ADD_AP_FLAG = (2 ** 11);

    const COUNTER_OFFSET = 2 ** 15 - 1;
    const MESSAGE_OFFSET_FINALIZE = 2 ** 15 - 3;
    const MESSAGE_OFFSET = 2 ** 15 - 3;
    const STATE_OFFSET_FINALIZE = 2 ** 15 - 6;
    const STATE_OFFSET = 2 ** 15 - 4;

    const COUNTER_SHIFT = 1;
    const STATE_SHIFT = 2 ** 16;
    const MESSAGE_SHIFT = 2 ** 32;
    const FLAGS_SHIFT = 2 ** 48;
    const OPCODE_EXT_SHIFT = 2 ** 63;

    const BLAKE2S_INSTRUCTION = COUNTER_OFFSET * COUNTER_SHIFT + STATE_OFFSET * STATE_SHIFT +
        MESSAGE_OFFSET * MESSAGE_SHIFT + (BLAKE2S_AP_FLAGS + BLAKE2S_ADD_AP_FLAG) * FLAGS_SHIFT +
        BLAKE2S_OPCODE_EXT * OPCODE_EXT_SHIFT;
    const BLAKE2S_FINALIZE_INSTRUCTION = COUNTER_OFFSET * COUNTER_SHIFT + STATE_OFFSET_FINALIZE *
        STATE_SHIFT + MESSAGE_OFFSET_FINALIZE * MESSAGE_SHIFT + (
            BLAKE2S_AP_FLAGS + BLAKE2S_ADD_AP_FLAG
        ) * FLAGS_SHIFT + BLAKE2S_FINALIZE_OPCODE_EXT * OPCODE_EXT_SHIFT;
    alloc_locals;

    let (local state: felt*) = alloc();
    assert state[0] = 0x6B08E647;  // IV[0] ^ 0x01010020 (config: no key, 32 bytes output).
    assert state[1] = 0xBB67AE85;
    assert state[2] = 0x3C6EF372;
    assert state[3] = 0xA54FF53A;
    assert state[4] = 0x510E527F;
    assert state[5] = 0x9B05688C;
    assert state[6] = 0x1F83D9AB;
    assert state[7] = 0x5BE0CD19;

    struct Locals {
        u32s_in_last_block: felt,
        blake_data_len_bytes: felt,
        range_check_ptr: felt,
        final_data: felt*,
    }

    local locals: Locals;
    static_assert cast(fp + 1, Locals*) == &locals;

    // Data length in bytes for non-finalize BLAKE.
    if (len == 0) {
        assert locals.u32s_in_last_block = 0;
        assert locals.range_check_ptr = range_check_ptr;
    } else {
        let (_, r) = unsigned_div_rem(len - 1, 16);
        assert locals.u32s_in_last_block = r + 1;
        assert locals.range_check_ptr = range_check_ptr;
    }
    assert locals.blake_data_len_bytes = (len - locals.u32s_in_last_block) * 4;
    let (final_data: felt*) = alloc();
    locals.final_data = final_data;

    // Copy remaining data and pad with zeroes.
    memcpy(final_data, &data[len - locals.u32s_in_last_block], locals.u32s_in_last_block);
    memset(&final_data[locals.u32s_in_last_block], 0, 16 - locals.u32s_in_last_block);

    static_assert fp - 3 == &out;

    struct LoopFrame {
        counter: felt,
        state: felt*,
        data: felt*,
    }
    tempvar frame = LoopFrame(counter=0, state=state, data=data);
    jmp check_if_done;

    loop:
    let frame = [cast(ap - LoopFrame.SIZE - 1, LoopFrame*)];

    tempvar counter = frame.counter + 64;
    // Blake output pointer / the next state.
    [ap] = &frame.state[8];
    static_assert ap + COUNTER_OFFSET - 2 ** 15 == &counter;
    static_assert ap + STATE_OFFSET - 2 ** 15 == &frame.state;
    static_assert ap + MESSAGE_OFFSET - 2 ** 15 == &frame.data;
    dw BLAKE2S_INSTRUCTION;

    // Due to the use of `dw` the compiler invalidates the references.
    let counter = cast([ap + COUNTER_OFFSET - 2 ** 15 - 1], felt);
    let data = cast([ap + MESSAGE_OFFSET - 2 ** 15 - 1], felt*);
    let new_state = cast([ap - 1], felt*);

    tempvar data = data + 16;
    static_assert ap - 3 == &counter;
    static_assert ap - 2 == &new_state;
    static_assert ap - 1 == &data;

    check_if_done:
    let frame = [cast(ap - LoopFrame.SIZE, LoopFrame*)];
    let locals = [cast(fp + 1, Locals*)];

    tempvar is_done = frame.counter - locals.blake_data_len_bytes;

    jmp loop if is_done != 0;

    tempvar data = locals.final_data;

    // Add remainder bytes to counter.
    tempvar counter = frame.counter + (locals.u32s_in_last_block * 4);

    let out = cast([fp - 3], felt*);
    [ap] = out;

    static_assert ap + COUNTER_OFFSET - 2 ** 15 == &counter;
    static_assert ap + STATE_OFFSET_FINALIZE - 2 ** 15 == &frame.state;
    static_assert ap + MESSAGE_OFFSET_FINALIZE - 2 ** 15 == &data;
    dw BLAKE2S_FINALIZE_INSTRUCTION;

    // The `range_check_ptr` must be redefined since the `dw` instruction invalidates it.
    let range_check_ptr = [fp + 3];
    return ();
}

// Given `data_len` felt252s at `data`, encodes them as u32s as defined in `encode_felt252s_to_u32s`
// and computes the blake2s hash of the result using the dedicated opcodes.
// The 256 bit result is then returned as a felt252 (i.e. modulo PRIME).
func encode_felt252_data_and_calc_blake_hash{range_check_ptr: felt}(
    data_len: felt, data: felt*
) -> (hash: felt) {
    alloc_locals;
    let (local encoded_data: felt*) = alloc();
    let encoded_data_len = encode_felt252s_to_u32s(
        packed_values_len=data_len, packed_values=data, unpacked_u32s=encoded_data
    );
    let (local blake_output: felt*) = alloc();
    blake_with_opcode(len=encoded_data_len, data=encoded_data, out=blake_output);
    return (
        hash=blake_output[7] * 2 ** 224 + blake_output[6] * 2 ** 192 + blake_output[5] * 2 ** 160 +
        blake_output[4] * 2 ** 128 + blake_output[3] * 2 ** 96 + blake_output[2] * 2 ** 64 +
        blake_output[1] * 2 ** 32 + blake_output[0],
    );
}

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.cairo_builtins import BitwiseBuiltin
from starkware.cairo.common.registers import get_fp_and_pc

const N_PACKED_INSTANCES = 7;
const ALL_ONES = 2 ** 251 - 1;
const SHIFTS = (
    1 + 2 ** 35 + 2 ** (35 * 2) + 2 ** (35 * 3) + 2 ** (35 * 4) + 2 ** (35 * 5) + 2 ** (35 * 6)
);

func mix{bitwise_ptr: BitwiseBuiltin*}(a: felt, b: felt, c: felt, d: felt, m0: felt, m1: felt) -> (
    a: felt, b: felt, c: felt, d: felt
) {
    alloc_locals;

    // Defining the following constant as local variables saves some instructions.
    local mask32ones = SHIFTS * (2 ** 32 - 1);

    // a = (a + b + m0) % 2**32.
    assert bitwise_ptr[0].x = a + b + m0;
    assert bitwise_ptr[0].y = mask32ones;
    tempvar a = bitwise_ptr[0].x_and_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    // d = right_rot((d ^ a), 16).
    assert bitwise_ptr[0].x = a;
    assert bitwise_ptr[0].y = d;
    tempvar a_xor_d = bitwise_ptr[0].x_xor_y;
    assert bitwise_ptr[1].x = a_xor_d;
    assert bitwise_ptr[1].y = SHIFTS * (2 ** 32 - 2 ** 16);
    tempvar d = (
        (2 ** (32 - 16)) * a_xor_d + (1 / 2 ** 16 - 2 ** (32 - 16)) * bitwise_ptr[1].x_and_y
    );
    let bitwise_ptr = bitwise_ptr + 2 * BitwiseBuiltin.SIZE;

    // c = (c + d) % 2**32.
    assert bitwise_ptr[0].x = c + d;
    assert bitwise_ptr[0].y = mask32ones;
    tempvar c = bitwise_ptr[0].x_and_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    // b = right_rot((b ^ c), 12).
    assert bitwise_ptr[0].x = b;
    assert bitwise_ptr[0].y = c;
    tempvar b_xor_c = bitwise_ptr[0].x_xor_y;
    assert bitwise_ptr[1].x = b_xor_c;
    assert bitwise_ptr[1].y = SHIFTS * (2 ** 32 - 2 ** 12);
    tempvar b = (
        (2 ** (32 - 12)) * b_xor_c + (1 / 2 ** 12 - 2 ** (32 - 12)) * bitwise_ptr[1].x_and_y
    );
    let bitwise_ptr = bitwise_ptr + 2 * BitwiseBuiltin.SIZE;

    // a = (a + b + m1) % 2**32.
    assert bitwise_ptr[0].x = a + b + m1;
    assert bitwise_ptr[0].y = mask32ones;
    tempvar a = bitwise_ptr[0].x_and_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    // d = right_rot((d ^ a), 8).
    assert bitwise_ptr[0].x = d;
    assert bitwise_ptr[0].y = a;
    tempvar d_xor_a = bitwise_ptr[0].x_xor_y;
    assert bitwise_ptr[1].x = d_xor_a;
    assert bitwise_ptr[1].y = SHIFTS * (2 ** 32 - 2 ** 8);
    tempvar d = (2 ** (32 - 8)) * d_xor_a + (1 / 2 ** 8 - 2 ** (32 - 8)) * bitwise_ptr[1].x_and_y;
    let bitwise_ptr = bitwise_ptr + 2 * BitwiseBuiltin.SIZE;

    // c = (c + d) % 2**32.
    assert bitwise_ptr[0].x = c + d;
    assert bitwise_ptr[0].y = mask32ones;
    tempvar c = bitwise_ptr[0].x_and_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    // b = right_rot((b ^ c), 7).
    assert bitwise_ptr[0].x = b;
    assert bitwise_ptr[0].y = c;
    tempvar b_xor_c = bitwise_ptr[0].x_xor_y;
    assert bitwise_ptr[1].x = b_xor_c;
    assert bitwise_ptr[1].y = SHIFTS * (2 ** 32 - 2 ** 7);
    tempvar b = (2 ** (32 - 7)) * b_xor_c + (1 / 2 ** 7 - 2 ** (32 - 7)) * bitwise_ptr[1].x_and_y;
    let bitwise_ptr = bitwise_ptr + 2 * BitwiseBuiltin.SIZE;

    return (a, b, c, d);
}

func blake_round{bitwise_ptr: BitwiseBuiltin*}(state: felt*, message: felt*, sigma: felt*) -> (
    new_state: felt*
) {
    let state0 = state[0];
    let state1 = state[1];
    let state2 = state[2];
    let state3 = state[3];
    let state4 = state[4];
    let state5 = state[5];
    let state6 = state[6];
    let state7 = state[7];
    let state8 = state[8];
    let state9 = state[9];
    let state10 = state[10];
    let state11 = state[11];
    let state12 = state[12];
    let state13 = state[13];
    let state14 = state[14];
    let state15 = state[15];

    let (state0, state4, state8, state12) = mix(
        state0, state4, state8, state12, message[sigma[0]], message[sigma[1]]
    );
    let (state1, state5, state9, state13) = mix(
        state1, state5, state9, state13, message[sigma[2]], message[sigma[3]]
    );
    let (state2, state6, state10, state14) = mix(
        state2, state6, state10, state14, message[sigma[4]], message[sigma[5]]
    );
    let (state3, state7, state11, state15) = mix(
        state3, state7, state11, state15, message[sigma[6]], message[sigma[7]]
    );

    let (state0, state5, state10, state15) = mix(
        state0, state5, state10, state15, message[sigma[8]], message[sigma[9]]
    );
    let (state1, state6, state11, state12) = mix(
        state1, state6, state11, state12, message[sigma[10]], message[sigma[11]]
    );
    let (state2, state7, state8, state13) = mix(
        state2, state7, state8, state13, message[sigma[12]], message[sigma[13]]
    );
    let (state3, state4, state9, state14) = mix(
        state3, state4, state9, state14, message[sigma[14]], message[sigma[15]]
    );

    let (new_state: felt*) = alloc();
    assert new_state[0] = state0;
    assert new_state[1] = state1;
    assert new_state[2] = state2;
    assert new_state[3] = state3;
    assert new_state[4] = state4;
    assert new_state[5] = state5;
    assert new_state[6] = state6;
    assert new_state[7] = state7;
    assert new_state[8] = state8;
    assert new_state[9] = state9;
    assert new_state[10] = state10;
    assert new_state[11] = state11;
    assert new_state[12] = state12;
    assert new_state[13] = state13;
    assert new_state[14] = state14;
    assert new_state[15] = state15;

    return (new_state=new_state);
}

// Performs the blake compression function.
//
// h is a list of 8 32-bit words.
// message is a list of 16 32-bit words.
// t1 and f1 are assumed to be 0.
func blake2s_compress{bitwise_ptr: BitwiseBuiltin*}(
    h: felt*, message: felt*, t0: felt, f0: felt, sigma: felt*, output: felt*
) {
    alloc_locals;
    let (__fp__, _) = get_fp_and_pc();

    // Compute state[12].
    assert bitwise_ptr[0].x = 0x510e527f * SHIFTS;
    assert bitwise_ptr[0].y = t0;
    let state12 = bitwise_ptr[0].x_xor_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    // Compute state[14].
    assert bitwise_ptr[0].x = 0x1f83d9ab * SHIFTS;
    assert bitwise_ptr[0].y = f0;
    let state14 = bitwise_ptr[0].x_xor_y;
    let bitwise_ptr = bitwise_ptr + BitwiseBuiltin.SIZE;

    local initial_state = h[0];
    local initial_state_ = h[1];
    local initial_state_ = h[2];
    local initial_state_ = h[3];
    local initial_state_ = h[4];
    local initial_state_ = h[5];
    local initial_state_ = h[6];
