from src.starkware.cairo.common.ec import StarkCurve, assert_on_curve, ec_add, ec_sub

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.cairo_builtins import EcOpBuiltin
from starkware.cairo.common.ec_point import EcPoint
from starkware.cairo.common.math import assert_not_zero
from starkware.cairo.common.memset import memset

// The maximal number of bits allowed in the scalar m.
const M_MAX_BITS = 252;

// Computes m * p where m is a scalar and p is a point on the STARK elliptic curve.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - the multiplication coefficient of p.
//
// Returns:
//   r = m * p.
//
// Assumptions:
//   p is a valid point on the curve.
func ec_mul_cairo(m: felt, p: EcPoint) -> (r: EcPoint) {
    alloc_locals;

    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (p.y == 0) {
        return (r=p);
    }

    // Define `q` for the following hint to work.
    let q = p;

    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(map(to_bytes, [ids.p.x, ids.p.y, ids.m, ids.q.x, ids.q.y]))
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);

    let (r_plus_s) = simulate_builtin_ec_op_with_cairo(p=s, m=m, q=p);
    let r: EcPoint = ec_sub(r_plus_s, s);
    return (r=r);
}

// Returns the result of the EC operation P + m * Q.
// where P = (p_x, p_y), Q = (q_x, q_y) are points on the elliptic curve defined as
// y^2 = x^3 + alpha * x + beta (mod prime).
//
// Mimics the operation of the AIR, so that this function fails whenever the builtin AIR
// would not yield a correct result, i.e. when any part of the computation attempts to add
// two points with the same x coordinate.
func simulate_builtin_ec_op_with_cairo(p: EcPoint, m: felt, q: EcPoint) -> (r: EcPoint) {
    alloc_locals;
    // Assert that the points are on the curve and are not the point at infinity.
    assert p.y * p.y = (p.x * p.x + StarkCurve.ALPHA) * p.x + StarkCurve.BETA;
    assert q.y * q.y = (q.x * q.x + StarkCurve.ALPHA) * q.x + StarkCurve.BETA;

    let (local m_bit_unpacking: felt*) = alloc();  // Starts from lsb.
    %{
        curr_m = ids.m
        for i in range(ids.M_MAX_BITS):
            memory[ids.m_bit_unpacking + i] = curr_m % 2
            curr_m = curr_m >> 1
    %}

    // Verify that the bit unpacking is of a number num smaller than PRIME.
    verify_bit_unpacking_is_reduced(unpacking=m_bit_unpacking);

    // Compute the result.
    let result = _ec_op_inner(
        partial_sum=p, doubled_point=q, m_bit_unpacking=m_bit_unpacking, index=0, curr_m=m
    );

    // Assert that the result is on the curve.
    assert_on_curve(p=result);

    // Output the result.
    return (r=result);
}

// Computes the EC operation partial_sum + curr_m * doubled_point.
// It is called recursively, with the recursion being terminated when the index reaches M_MAX_BITS.
// The function also verifies that the bit unpacking is indeed of curr_m (modulo PRIME).
func _ec_op_inner(
    partial_sum: EcPoint, doubled_point: EcPoint, m_bit_unpacking: felt*, index: felt, curr_m: felt
) -> EcPoint {
    alloc_locals;
    if (index == M_MAX_BITS) {
        assert curr_m = 0;
        return partial_sum;
    }

    tempvar x_diff = doubled_point.x - partial_sum.x;
    assert_not_zero(x_diff);

    if (m_bit_unpacking[0] == 0) {
        tempvar partial_sum = partial_sum;
    } else {
        // Inline ec_add for input p=partial_sum, q=doubled_point.
        // Note: no need to compare doubled_point.y to 0 since simulate_builtin_ec_op_with_cairo
        // has already verified that p is not the point at infinity and every time partial_sum
        // gets updated, it is the addition of two points with different x coordinates.
        // We also do not need to address the case where partial_sum.x == doubled_point.x because
        // we have already verified that it is not the case.
        assert m_bit_unpacking[0] = 1;
        tempvar slope = (doubled_point.y - partial_sum.y) / x_diff;
        tempvar r_x = slope * slope - partial_sum.x - doubled_point.x;
        tempvar partial_sum = EcPoint(x=r_x, y=slope * (partial_sum.x - r_x) - partial_sum.y);
    }

    // Inline ec_double for input p=doubled_point.
    // Note: we do not need to compare doubled_point.y to 0 since simulate_builtin_ec_op_with_cairo
    // has already verified that q is not the point at infinity and doubled_point = 2**index * q
    // and the EC group is of an odd order.
    tempvar slope = (3 * doubled_point.x * doubled_point.x + StarkCurve.ALPHA) / (
        doubled_point.y + doubled_point.y
    );
    tempvar r_x = slope * slope - doubled_point.x - doubled_point.x;
    local doubled_point: EcPoint = EcPoint(
        x=r_x, y=slope * (doubled_point.x - r_x) - doubled_point.y
    );

    tempvar x_diff = doubled_point.x - partial_sum.x;
    assert_not_zero(x_diff);

    if (m_bit_unpacking[1] == 0) {
        tempvar partial_sum = partial_sum;
    } else {
        // Inline ec_add for input p=partial_sum, q=doubled_point.
        assert m_bit_unpacking[1] = 1;
        tempvar slope = (doubled_point.y - partial_sum.y) / x_diff;
        tempvar r_x = slope * slope - partial_sum.x - doubled_point.x;
        tempvar partial_sum = EcPoint(x=r_x, y=slope * (partial_sum.x - r_x) - partial_sum.y);
    }

    // Inline ec_double for input p=doubled_point.
    tempvar slope = (3 * doubled_point.x * doubled_point.x + StarkCurve.ALPHA) / (
        doubled_point.y + doubled_point.y
    );
    tempvar r_x = slope * slope - doubled_point.x - doubled_point.x;
    let doubled_point: EcPoint = EcPoint(
        x=r_x, y=slope * (doubled_point.x - r_x) - doubled_point.y
    );

    return _ec_op_inner(
        partial_sum=partial_sum,
        doubled_point=doubled_point,
        m_bit_unpacking=m_bit_unpacking + 2,
        index=index + 2,
        curr_m=(curr_m - m_bit_unpacking[0] - m_bit_unpacking[1] - m_bit_unpacking[1]) / 4,
    );
}

// Asserts that the bit unpacking is of a number num smaller than PRIME.
func verify_bit_unpacking_is_reduced(unpacking: felt*) {
    // The four bits set to one in binary representation of the Stone prime, from most significant
    // to least significant.
    const P_ONE_BIT_POS_1 = 251;
    const P_ONE_BIT_POS_2 = 196;
    const P_ONE_BIT_POS_3 = 192;
    const P_ONE_BIT_POS_4 = 0;
    if (unpacking[P_ONE_BIT_POS_1] == 0) {
        return ();
    }
    memset(dst=&unpacking[P_ONE_BIT_POS_2 + 1], value=0, n=P_ONE_BIT_POS_1 - P_ONE_BIT_POS_2 - 1);
    if (unpacking[P_ONE_BIT_POS_2] == 0) {
        return ();
    }
    memset(dst=&unpacking[P_ONE_BIT_POS_3 + 1], value=0, n=P_ONE_BIT_POS_2 - P_ONE_BIT_POS_3 - 1);
    if (unpacking[P_ONE_BIT_POS_3] == 0) {
        return ();
    }
    memset(dst=&unpacking[P_ONE_BIT_POS_4 + 1], value=0, n=P_ONE_BIT_POS_3 - P_ONE_BIT_POS_4 - 1);
    assert unpacking[P_ONE_BIT_POS_4] = 0;
    return ();
}

from src.starkware.cairo.common.cairo_ec_op.ec_op import ec_mul_cairo

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.bool import FALSE, TRUE
from starkware.cairo.common.cairo_builtins import ModBuiltin, UInt384
from starkware.cairo.common.ec import StarkCurve, ec_add, ec_sub, is_x_on_curve, recover_y
from starkware.cairo.common.ec_point import EcPoint
from starkware.cairo.common.registers import get_label_location

// StarkCurve.ORDER partitioned into 4 96-bit limbs, as required by the ModBuiltin.
const ORDER0 = 0xcae7b2321e66a241adc64d2f;
const ORDER1 = 0xffffffffffffffffb781126d;
const ORDER2 = 0x800000000000010;
const ORDER3 = 0;

// Checks if (signature_r, signature_s) is a valid signature for the given public_key
// on the given message. Fails if the signature is invalid.
//
// Arguments:
//   message - the signed message.
//   public_key - the public key corresponding to the key with which the message was signed.
//   signature_r - the r component of the ECDSA signature.
//   signature_s - the s component of the ECDSA signature.
//
// Note that the implementation in Stone forbids signatures where r >= 2**251 or w = 1/s >= 2**251.
func verify_ecdsa_signature_cairo{range_check96_ptr, mul_mod_ptr: ModBuiltin*}(
    message, public_key, signature_r, signature_s
) {
    alloc_locals;
    // Check that s != 0 (mod StarkCurve.ORDER).
    if (signature_s == 0) {
        [fp] = [fp] + 1;
    }
    if (signature_s == StarkCurve.ORDER) {
        [fp] = [fp] + 1;
    }
    if (signature_r == StarkCurve.ORDER) {
        [fp] = [fp] + 1;
    }
    // Check that r is the x coordinate of a point on the curve.
    // Note that this ensures that r != 0.
    let on_curve: felt = is_x_on_curve(signature_r);
    if (on_curve == FALSE) {
        [fp] = [fp] + 1;
    }
    // Compute w=1/s (mod StarkCurve.ORDER).
    // also compute wz = w * message and wr = w * signature_r.
    local w;
    local wz;
    local wr;
    %{
        # ids.StarkCurve.ORDER is parsed as a negative number.
        order = ids.StarkCurve.ORDER + PRIME
        ids.w = pow(ids.signature_s, -1, order)
        ids.wz = ids.w*ids.message % order
        ids.wr = ids.w*ids.signature_r % order
    %}

    // Reserve 28 RC96 units for the values array.
    let values_arr = cast(range_check96_ptr, UInt384*);
    let range_check96_ptr = range_check96_ptr + 28;

    mod_curve_felt_to_uint384(w, &values_arr[0]);
    mod_curve_felt_to_uint384(signature_s, &values_arr[1]);
    assert values_arr[2] = UInt384(1, 0, 0, 0);
    mod_curve_felt_to_uint384(message, &values_arr[3]);
    mod_curve_felt_to_uint384(wz, &values_arr[4]);
    mod_curve_felt_to_uint384(signature_r, &values_arr[5]);
    mod_curve_felt_to_uint384(wr, &values_arr[6]);

    let (mul_mod_offsets_ptr) = get_label_location(mul_mod_offsets_values);
    tempvar ec_order = UInt384(ORDER0, ORDER1, ORDER2, ORDER3);
    assert mul_mod_ptr[0].p = ec_order;
    assert mul_mod_ptr[0].values_ptr = values_arr;
    assert mul_mod_ptr[0].offsets_ptr = mul_mod_offsets_ptr;
    assert mul_mod_ptr[0].n = 3;
    // Fill the `mul_mod` segment in cairo to workaround a bug in the Rust hint.
    assert mul_mod_ptr[1].p = ec_order;
    assert mul_mod_ptr[1].values_ptr = values_arr;
    assert mul_mod_ptr[1].offsets_ptr = mul_mod_offsets_ptr + 3;
    assert mul_mod_ptr[1].n = 2;
    assert mul_mod_ptr[2].p = ec_order;
    assert mul_mod_ptr[2].values_ptr = values_arr;
    assert mul_mod_ptr[2].offsets_ptr = mul_mod_offsets_ptr + 6;
    assert mul_mod_ptr[2].n = 1;
    let mul_mod_ptr = &mul_mod_ptr[3];

    // To verify ECDSA, obtain:
    //   wzG = wz * G, where G is a generator of the EC.
    //   wrQ = wr * Q, where Q.x = public_key.
    // and check that:
    //   wzG +/- wrQ = +/- R, or more efficiently that:
    //   (wzG +/- wrQ).x = R.x.
    let (wzG: EcPoint) = ec_mul_cairo(m=wz, p=EcPoint(x=StarkCurve.GEN_X, y=StarkCurve.GEN_Y));
    let (public_key_point: EcPoint) = recover_y(public_key);
    let (wrQ: EcPoint) = ec_mul_cairo(wr, public_key_point);

    let (candidate: EcPoint) = ec_add(wzG, wrQ);
    if (candidate.x == signature_r) {
        return ();
    }

    let (candidate: EcPoint) = ec_sub(wzG, wrQ);
    if (candidate.x == signature_r) {
        return ();
    }

    [fp] = [fp] + 1;

    return ();

    mul_mod_offsets_values:
    dw 0;  // w
    dw 4;  // signature_s
    dw 8;  // 1
    dw 0;  // w
    dw 12;  // message
    dw 16;  // wz
    dw 0;  // w
    dw 20;  // signature_r
    dw 24;  // wr
}

// Splits a felt into four 96-bit limbs, as required by the ModBuiltin, and verifies the
// correctness of that partition.
// Assumes that res_pointer refers to a region constrained by the 96-bit range check.
// Under this assumption, the function also ensures the partition corresponds to a value
// within [0, PRIME).
func mod_curve_felt_to_uint384{range_check96_ptr}(num: felt, res_pointer: UInt384*) {
    let res_96_felts = cast(res_pointer, felt*);
    %{
        num = ids.num
        memory[ids.res_96_felts] = num % (2**96)
        memory[ids.res_96_felts+1] = (num>>96) % (2**96)
        memory[ids.res_96_felts+2] = (num>>(2*96)) % (2**96)
    %}
    assert res_pointer.d3 = 0;
    tempvar d0 = res_pointer.d0;
    tempvar d1 = res_pointer.d1;
    tempvar d2 = res_pointer.d2;
    assert d0 + d1 * (2 ** 96) + d2 * (2 ** 192) = num;

    if (d2 == (2 ** 59 + 17)) {
        assert d0 = 0;
        assert d1 = 0;
        return ();
    }
    // Note that d2 is also range checked by RC96.
    assert [range_check96_ptr] = d2 + 2 ** 96 - (2 ** 59 + 17);
    let range_check96_ptr = range_check96_ptr + 1;
    return ();
}

// This module provides a set of functions to compute the (Ethereuem compatible) keccak hash
// function.
//
// In order to use the functions that get the ``keccak_ptr`` implicit argument
// (e.g., ``cairo_keccak_uint256s()``, ``cairo_keccak()``, ...) you should:
//
//   1. Create a new memory segment using ``alloc()`` and store it in a variable named
//      ``keccak_ptr``.
//   2. Create a copy of the pointer, and name it ``keccak_ptr_start``, before using keccak.
//   3. Use the keccak functions with the ``keccak_ptr`` implicit argument
//      (either use the ``with`` statement or write ``{keccak_ptr=keccak_ptr}`` explicitly).
//   4. Call ``finalize_keccak()`` (once) at the end of your program/transaction.
//
// For example:
//
//   let (keccak_ptr: felt*) = alloc();
//   local keccak_ptr_start: felt* = keccak_ptr;
//
//   with keccak_ptr {
//     cairo_keccak_uint256s(...);
//     cairo_keccak_uint256s(...);
//   }
//
//   finalize_keccak(keccak_ptr_start=keccak_ptr_start, keccak_ptr_end=keccak_ptr);
//
// It's more efficient to reuse the ``keccak_ptr`` segment for all the keccak functions you need,
// and call ``finalize_keccak()`` once, because of an internal batching done inside
// ``finalize_keccak()``.
//
// Failing to call ``finalize_keccak()``, will make the keccak function unsound - the prover will be
// able to choose any value as the keccak's result.
//
// The module also uses a set of helper functions to prepare the input data for keccak,
// such as ``keccak_add_uint256()`` and ``keccak_add_felt()``. To use them, you should allocate
// a new memory segment to variable named ``inputs`` (this value is an implicit argument to those
// functions). Once the input is ready, you should call ``cairo_keccak()`` or
// ``cairo_keccak_bigend()``.
// Don't forget to call ``finalize_keccak()`` at the end of the program/transaction.

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.bitwise import bitwise_xor
from starkware.cairo.common.cairo_builtins import BitwiseBuiltin
from starkware.cairo.common.keccak_utils.keccak_utils import keccak_add_felts, keccak_add_uint256s
from starkware.cairo.common.cairo_keccak.packed_keccak import BLOCK_SIZE, packed_keccak_func
from starkware.cairo.common.math import assert_nn_le, unsigned_div_rem
from starkware.cairo.common.memcpy import memcpy
from starkware.cairo.common.memset import memset
from starkware.cairo.common.pow import pow
from starkware.cairo.common.uint256 import Uint256, uint256_reverse_endian

const KECCAK_STATE_SIZE_FELTS = 25;
const KECCAK_FULL_RATE_IN_BYTES = 136;
const KECCAK_FULL_RATE_IN_WORDS = 17;
const KECCAK_CAPACITY_IN_WORDS = 8;
const BYTES_IN_WORD = 8;

// Computes the keccak hash of multiple uint256 numbers.
func cairo_keccak_uint256s{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    n_elements: felt, elements: Uint256*
) -> (res: Uint256) {
    alloc_locals;

    let (inputs) = alloc();
    let inputs_start = inputs;

    keccak_add_uint256s{inputs=inputs}(n_elements=n_elements, elements=elements, bigend=0);

    return cairo_keccak(inputs=inputs_start, n_bytes=n_elements * 32);
}

// Computes the keccak hash of multiple uint256 numbers (big-endian).
// Note that both the output and the input are in big endian representation.
func cairo_keccak_uint256s_bigend{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    n_elements: felt, elements: Uint256*
) -> (res: Uint256) {
    alloc_locals;

    let (inputs) = alloc();
    let inputs_start = inputs;

    keccak_add_uint256s{inputs=inputs}(n_elements=n_elements, elements=elements, bigend=1);

    return cairo_keccak_bigend(inputs=inputs_start, n_bytes=n_elements * 32);
}

// Computes the keccak hash of multiple field elements.
func cairo_keccak_felts{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    n_elements: felt, elements: felt*
) -> (res: Uint256) {
    alloc_locals;

    let (inputs) = alloc();
    let inputs_start = inputs;

    keccak_add_felts{inputs=inputs}(n_elements=n_elements, elements=elements, bigend=0);

    return cairo_keccak(inputs=inputs_start, n_bytes=n_elements * 32);
}

// Computes the keccak hash of multiple field elements (big-endian).
// Note that both the output and the input are in big endian representation.
func cairo_keccak_felts_bigend{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    n_elements: felt, elements: felt*
) -> (res: Uint256) {
    alloc_locals;

    let (inputs) = alloc();
    let inputs_start = inputs;

    keccak_add_felts{inputs=inputs}(n_elements=n_elements, elements=elements, bigend=1);

    return cairo_keccak_bigend(inputs=inputs_start, n_bytes=n_elements * 32);
}

// Computes the keccak of 'input'.
// To use this function, split the input into words of 64 bits (little endian).
// For example, to compute keccak('Hello world!'), use:
//   inputs = [8031924123371070792, 560229490]
// where:
//   8031924123371070792 == int.from_bytes(b'Hello wo', 'little')
//   560229490 == int.from_bytes(b'rld!', 'little')
//
// Returns the hash as a Uint256.
//
// Note: You must call finalize_keccak() at the end of the program. Otherwise, this function
// is not sound and a malicious prover may return a wrong result.
func cairo_keccak{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    inputs: felt*, n_bytes: felt
) -> (res: Uint256) {
    let (output) = cairo_keccak_as_words(inputs=inputs, n_bytes=n_bytes);

    let res_low = output[1] * 2 ** 64 + output[0];
    let res_high = output[3] * 2 ** 64 + output[2];

    return (res=Uint256(low=res_low, high=res_high));
}

// Same as keccak, but outputs the hash in big endian representation.
// Note that the input is still treated as little endian.
func cairo_keccak_bigend{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    inputs: felt*, n_bytes: felt
) -> (res: Uint256) {
    let (hash) = cairo_keccak(inputs=inputs, n_bytes=n_bytes);
    let (res) = uint256_reverse_endian(num=hash);
    return (res=res);
}

// Same as keccak, but outputs a pointer to 4 64-bit little endian words instead.
func cairo_keccak_as_words{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    inputs: felt*, n_bytes: felt
) -> (output: felt*) {
    alloc_locals;

    let (local state) = alloc();
    memset(dst=state, value=0, n=KECCAK_STATE_SIZE_FELTS);

    return _keccak(inputs=inputs, n_bytes=n_bytes, state=state);
}

// Prepares a block for the block permutation: adds padding (of the form 100...001, see the
// _padding function) and capacity (8 64-bits words of zeros) to the input, xors the result
// with the previous block permutation's output, and writes it to keccak_ptr.
//
// This function is called for every block that is sent to the _block_permutation
// function. Each time it is called with a chunk of the input of at
// most 17 64-bit words. That is, with n_bytes <= 136. When it is called with exactly 136
// bytes, no padding is added. Only the last block is padded.
//
// Arguments:
//   inputs - chunk of the input, in little endian.
//   n_bytes - the length of inputs in bytes. Must be in the range [0, 136].
//   state - the output of the previous block permutation that contains 25 64-bits words.
func _prepare_block{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    inputs: felt*, n_bytes: felt, state: felt*
) {
    alloc_locals;

    let inputs_start = inputs;
    _copy_inputs{inputs=inputs, n_bytes=n_bytes, state=state}();
    // n_words_written is the number of words written to keccak_ptr.
    let n_words_written = inputs - inputs_start;

    tempvar padding_len = (KECCAK_FULL_RATE_IN_WORDS - n_words_written);
    local input_word;
    if (n_bytes == 0) {
        input_word = 0;
    } else {
        input_word = inputs[0];
    }

    _padding(input_word=input_word, n_bytes=n_bytes, state=state, padding_len=padding_len);
    let state = state + padding_len;

    // Since the capacity part consists of zeros, we simply copy the state.
    memcpy(dst=keccak_ptr, src=state, len=KECCAK_CAPACITY_IN_WORDS);
    let keccak_ptr = keccak_ptr + KECCAK_CAPACITY_IN_WORDS;

    return ();
}

// Xors full words from the input with the corresponding words from the output of the
// previous block permutation, and writes the restult to keccak_ptr.
func _copy_inputs{
    range_check_ptr,
    bitwise_ptr: BitwiseBuiltin*,
    keccak_ptr: felt*,
    inputs: felt*,
    n_bytes: felt,
    state: felt*,
}() {
    if (nondet %{ ids.n_bytes < ids.BYTES_IN_WORD %} != 0) {
        assert_nn_le(n_bytes, BYTES_IN_WORD - 1);
        return ();
    }

    let (next_word) = bitwise_xor(inputs[0], state[0]);
    assert keccak_ptr[0] = next_word;

    let inputs = &inputs[1];
    let state = &state[1];
    let keccak_ptr = &keccak_ptr[1];
    let n_bytes = n_bytes - BYTES_IN_WORD;

    return _copy_inputs();
}

// Adds padding of the form 100...001 to the last bytes of the input, to a total of
// padding_len words, xors the result with the output of the last block permutation,
// from the corresponding offset, and writes it to keccak_ptr.
//
// Arguments:
//   input_word - the last word of the input to cairo_keccak (given in little endian)
//       if it has less than 8 bytes, otherwise 0.
//   n_bytes - the number of bytes in input_word. Must be in the range [0, 8).
//   state - the output of the last block permutation, from the word that corresponds
//       to the input_word. (i.e., if input_word is the i-th word in the current block,
//       then state points to the i-th word of the last block permutation's output).
//   padding_len - the length of the required padding (in words). Must be in the range [0, 17].
func _padding{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    input_word: felt, n_bytes: felt, state: felt*, padding_len: felt
) {
    if (padding_len == 0) {
        return ();
    }

    let (first_one) = pow(256, n_bytes);
    // The beginning of the padding with the last bytes of the input and the first 1.
    let input_word_with_initial_padding = input_word + first_one;

    if (padding_len == 1) {
        let both_ones = 2 ** 63 + input_word_with_initial_padding;
        let (word) = bitwise_xor(both_ones, state[0]);

        assert keccak_ptr[0] = word;
        let keccak_ptr = &keccak_ptr[1];

        return ();
    }

    return _long_padding(
        input_word_with_initial_padding=input_word_with_initial_padding,
        state=state,
        padding_len=padding_len,
    );
}

// Padding of more than 1 word.
func _long_padding{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    input_word_with_initial_padding: felt, state: felt*, padding_len: felt
) {
    alloc_locals;

    // First word.
    let (first_one) = bitwise_xor(input_word_with_initial_padding, state[0]);
    assert keccak_ptr[0] = first_one;
    let keccak_ptr = &keccak_ptr[1];
    let state = state + 1;

    // The padding of the inner words is zero, so we should simply copy them.
    memcpy(dst=keccak_ptr, src=state, len=padding_len - 2);
    let keccak_ptr = keccak_ptr + padding_len - 2;
    let state = state + padding_len - 2;

    // Last word.
    let (second_one) = bitwise_xor(2 ** 63, state[0]);
    assert keccak_ptr[0] = second_one;
    let keccak_ptr = &keccak_ptr[1];

    return ();
}

func _block_permutation{keccak_ptr: felt*}() {
    %{
        from starkware.cairo.common.keccak_utils.keccak_utils import keccak_func
        _keccak_state_size_felts = int(ids.KECCAK_STATE_SIZE_FELTS)
        assert 0 <= _keccak_state_size_felts < 100

        output_values = keccak_func(memory.get_range(
            ids.keccak_ptr - _keccak_state_size_felts, _keccak_state_size_felts))
        segments.write_arg(ids.keccak_ptr, output_values)
    %}
    let keccak_ptr = keccak_ptr + KECCAK_STATE_SIZE_FELTS;

    return ();
}

func _keccak{range_check_ptr, bitwise_ptr: BitwiseBuiltin*, keccak_ptr: felt*}(
    inputs: felt*, n_bytes: felt, state: felt*
) -> (output: felt*) {
    if (nondet %{ ids.n_bytes >= ids.KECCAK_FULL_RATE_IN_BYTES %} != 0) {
        _prepare_block(inputs=inputs, n_bytes=KECCAK_FULL_RATE_IN_BYTES, state=state);
        _block_permutation();

        return _keccak(
            inputs=inputs + KECCAK_FULL_RATE_IN_WORDS,
            n_bytes=n_bytes - KECCAK_FULL_RATE_IN_BYTES,
            state=keccak_ptr - KECCAK_STATE_SIZE_FELTS,
        );
    }

    assert_nn_le(n_bytes, KECCAK_FULL_RATE_IN_BYTES - 1);

    _prepare_block(inputs=inputs, n_bytes=n_bytes, state=state);
    _block_permutation();

    return (output=keccak_ptr - KECCAK_STATE_SIZE_FELTS);
}

// Verifies that the results of cairo_keccak() are valid. For optimization, this can be called only
// once after all the keccak calculations are completed.
func finalize_keccak{range_check_ptr, bitwise_ptr: BitwiseBuiltin*}(
    keccak_ptr_start: felt*, keccak_ptr_end: felt*
) {
    alloc_locals;

    tempvar n = (keccak_ptr_end - keccak_ptr_start) / (2 * KECCAK_STATE_SIZE_FELTS);
    if (n == 0) {
        return ();
    }

    %{
        # Add dummy pairs of input and output.
        _keccak_state_size_felts = int(ids.KECCAK_STATE_SIZE_FELTS)
        _block_size = int(ids.BLOCK_SIZE)
        assert 0 <= _keccak_state_size_felts < 100
        assert 0 <= _block_size < 10
        inp = [0] * _keccak_state_size_felts
        padding = (inp + keccak_func(inp)) * _block_size
        segments.write_arg(ids.keccak_ptr_end, padding)
    %}

    // Compute the amount of blocks (rounded up).
    let (local q, r) = unsigned_div_rem(n + BLOCK_SIZE - 1, BLOCK_SIZE);
    _finalize_keccak_inner(keccak_ptr_start, n=q);
    return ();
}

// Handles n blocks of BLOCK_SIZE keccak instances.
func _finalize_keccak_inner{range_check_ptr, bitwise_ptr: BitwiseBuiltin*}(
    keccak_ptr: felt*, n: felt
) {
    if (n == 0) {
        return ();
    }

    ap += SIZEOF_LOCALS;

    local MAX_VALUE = 2 ** 64 - 1;

    let keccak_ptr_start = keccak_ptr;

    let (local inputs_start: felt*) = alloc();

    // Handle inputs.

    tempvar inputs = inputs_start;
    tempvar keccak_ptr = keccak_ptr;
    tempvar range_check_ptr = range_check_ptr;
    tempvar m = 25;

    input_loop:
    tempvar x0 = keccak_ptr[0];
    assert [range_check_ptr] = x0;
    assert [range_check_ptr + 1] = MAX_VALUE - x0;
    tempvar x1 = keccak_ptr[50];
    assert [range_check_ptr + 2] = x1;
    assert [range_check_ptr + 3] = MAX_VALUE - x1;
    tempvar x2 = keccak_ptr[100];
    assert [range_check_ptr + 4] = x2;
    assert [range_check_ptr + 5] = MAX_VALUE - x2;
    assert inputs[0] = x0 + 2 ** 64 * x1 + 2 ** 128 * x2;

    tempvar inputs = inputs + 1;
    tempvar keccak_ptr = keccak_ptr + 1;
    tempvar range_check_ptr = range_check_ptr + 6;
    tempvar m = m - 1;
    jmp input_loop if m != 0;

    // Run keccak on the 3 instances.

    let (outputs) = packed_keccak_func(inputs_start);
    local bitwise_ptr: BitwiseBuiltin* = bitwise_ptr;

    // Handle outputs.

    tempvar outputs = outputs;
    tempvar keccak_ptr = keccak_ptr;
    tempvar range_check_ptr = range_check_ptr;
    tempvar m = 25;

    output_loop:
    tempvar x0 = keccak_ptr[0];
    assert [range_check_ptr] = x0;
    assert [range_check_ptr + 1] = MAX_VALUE - x0;
    tempvar x1 = keccak_ptr[50];
    assert [range_check_ptr + 2] = x1;
    assert [range_check_ptr + 3] = MAX_VALUE - x1;
    tempvar x2 = keccak_ptr[100];
    assert [range_check_ptr + 4] = x2;
    assert [range_check_ptr + 5] = MAX_VALUE - x2;
    assert outputs[0] = x0 + 2 ** 64 * x1 + 2 ** 128 * x2;

    tempvar outputs = outputs + 1;
    tempvar keccak_ptr = keccak_ptr + 1;
    tempvar range_check_ptr = range_check_ptr + 6;
    tempvar m = m - 1;
    jmp output_loop if m != 0;

    return _finalize_keccak_inner(keccak_ptr=keccak_ptr_start + 150, n=n - 1);
}

// Functions for various actions on the STARK curve:
//   y^2 = x^3 + alpha * x + beta
// where alpha = 1 and beta = 0x6f21413efbe40de150e596d72f7a8c5609ad26c15c915c1f4cdfcb99cee9e89.
// The point at infinity is represented as (0, 0).

from starkware.cairo.common.cairo_builtins import EcOpBuiltin
from starkware.cairo.common.ec_point import EcPoint
from starkware.cairo.common.math import is_quad_residue

namespace StarkCurve {
    const ALPHA = 1;
    const BETA = 0x6f21413efbe40de150e596d72f7a8c5609ad26c15c915c1f4cdfcb99cee9e89;
    const ORDER = 0x800000000000010ffffffffffffffffb781126dcae7b2321e66a241adc64d2f;
    const GEN_X = 0x1ef15c18599971b7beced415a40f0c7deacfd9b0d1819e03d723d8bc943cfca;
    const GEN_Y = 0x5668060aa49730b7be4801df46ec62de53ecd11abe43a32873000c36e8dc1f;
}

// Asserts that an EC point is on the STARK curve.
//
// Arguments:
//   p - an EC point.
func assert_on_curve(p: EcPoint) {
    // Because the curve order is odd, there is no point (except (0, 0), which represents the point
    // at infinity) with y = 0.
    if (p.y == 0) {
        assert p.x = 0;
        return ();
    }
    tempvar rhs = (p.x * p.x + StarkCurve.ALPHA) * p.x + StarkCurve.BETA;
    assert p.y * p.y = rhs;
    return ();
}

// Doubles a point (computes p + p) on the elliptic curve.
//
// Arguments:
//   p - an EC point.
//
// Returns:
//   r = p + p.
//
// Assumptions:
//   p is a valid point on the curve.
func ec_double(p: EcPoint) -> (r: EcPoint) {
    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (p.y == 0) {
        return (r=p);
    }
    tempvar slope = (3 * p.x * p.x + StarkCurve.ALPHA) / (2 * p.y);
    tempvar r_x = slope * slope - p.x - p.x;
    return (r=EcPoint(x=r_x, y=slope * (p.x - r_x) - p.y));
}

// Adds two points on the EC.
//
// Arguments:
//   p - an EC point.
//   q - an EC point.
//
// Returns:
//   r = p + q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_add(p: EcPoint, q: EcPoint) -> (r: EcPoint) {
    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (p.y == 0) {
        return (r=q);
    }
    if (q.y == 0) {
        return (r=p);
    }
    if (p.x == q.x) {
        if (p.y == q.y) {
            return ec_double(p);
        }
        // In this case, because p and q are on the curve, p.y = -q.y.
        return (r=EcPoint(x=0, y=0));
    }
    tempvar slope = (p.y - q.y) / (p.x - q.x);
    tempvar r_x = slope * slope - p.x - q.x;
    return (r=EcPoint(x=r_x, y=slope * (p.x - r_x) - p.y));
}

// Subtracts a point from another on the EC.
//
// Arguments:
//   p - an EC point.
//   q - an EC point.
//
// Returns:
//   r = p - q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_sub(p: EcPoint, q: EcPoint) -> (r: EcPoint) {
    return ec_add(p=p, q=EcPoint(x=q.x, y=-q.y));
}

// Computes p + m * q on the elliptic curve.
// Because the EC operation builtin cannot handle inputs where additions of points with the same x
// coordinate arise during the computation, this function adds and subtracts a nondeterministic
// point s to the computation, so that regardless of input, the probability that such additions
// arise will become negligibly small.
// The precise computation is therefore:
// ((p + s) + m * q) - s
// so that the inputs to the builtin itself are (p + s), m, and q.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - the multiplication coefficient of Q.
//   q - an EC point.
//
// Returns:
//   r = p + m * q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_op{ec_op_ptr: EcOpBuiltin*}(p: EcPoint, m: felt, q: EcPoint) -> (r: EcPoint) {
    alloc_locals;

    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (q.y == 0) {
        return (r=p);
    }

    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(map(to_bytes, [ids.p.x, ids.p.y, ids.m, ids.q.x, ids.q.y]))
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);
    let p_plus_s: EcPoint = ec_add(p, s);

    assert ec_op_ptr.p = p_plus_s;
    assert ec_op_ptr.m = m;
    assert ec_op_ptr.q = q;
    let r: EcPoint = ec_add(ec_op_ptr.r, EcPoint(x=s.x, y=-s.y));
    let ec_op_ptr = ec_op_ptr + EcOpBuiltin.SIZE;
    return (r=r);
}

// Computes m * p on the elliptic curve.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   m - the multiplication coefficient of p.
//   p - an EC point.
//
// Returns:
//   r = m * p.
//
// Assumptions:
//   p is a valid point on the curve.
func ec_mul{ec_op_ptr: EcOpBuiltin*}(m: felt, p: EcPoint) -> (r: EcPoint) {
    return ec_op(p=EcPoint(x=0, y=0), m=m, q=p);
}

// Computes p + m[0] * q[0] + m[1] * q[1] + ... m[len - 1] * q[len - 1] on the elliptic curve.
// Because the EC operation builtin cannot handle inputs where additions of points with the same x
// coordinate arise during the computation, this function adds and removes a nondeterministic
// point s to the computation, so that regardless of input, the probability that such additions
// arise will become negligibly small.
// The precise computation is therefore:
// ((p + s) + m[0] * q[0] + m[1] + q[1] + ... + m[len - 1] * q[len - 1]) - s.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - an array of multiplication coefficients.
//   q - an array of EC points.
//   len - the number of points in q.
//
// Returns:
//   r = p + m[0] * q[0] + m[1] * q[1] + ... + m[len - 1] * q[len - 1].
// Assumptions:
//   * All given EC points are on the STARK curve.
//   * len <= 1000.
func chained_ec_op{ec_op_ptr: EcOpBuiltin*}(p: EcPoint, m: felt*, q: EcPoint*, len: felt) -> (
    r: EcPoint
) {
    alloc_locals;
    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        n_elms = ids.len
        assert isinstance(n_elms, int) and n_elms >= 0, \
            f'Invalid value for len. Got: {n_elms}.'
        if '__chained_ec_op_max_len' in globals():
            assert n_elms <= __chained_ec_op_max_len, \
                f'chained_ec_op() can only be used with len<={__chained_ec_op_max_len}. ' \
                f'Got: n_elms={n_elms}.'

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(
            map(
                to_bytes,
                [
                    ids.p.x,
                    ids.p.y,
                    *memory.get_range(ids.m, n_elms),
                    *memory.get_range(ids.q.address_, 2 * n_elms),
                ],
            )
        )
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);
    let p_plus_s: EcPoint = ec_add(p, s);
    let r_plus_s: EcPoint = _chained_ec_op_inner(p=p_plus_s, m=m, q=q, len=len);
    let r: EcPoint = ec_add(r_plus_s, EcPoint(x=s.x, y=-s.y));
    return (r=r);
}

func _chained_ec_op_inner{ec_op_ptr: EcOpBuiltin*}(
    p: EcPoint, m: felt*, q: EcPoint*, len: felt
) -> (r: EcPoint) {
    if (len == 0) {
        return (r=p);
    }
    // (0, 0), representing the point at infinity, is the only point for which y = 0.
    if (q.y == 0) {
        return _chained_ec_op_inner(p=p, m=&m[1], q=&q[1], len=len - 1);
    }
    assert ec_op_ptr.p = p;
    assert ec_op_ptr.m = m[0];
    assert ec_op_ptr.q = q[0];
    let r = ec_op_ptr.r;
    let ec_op_ptr = &ec_op_ptr[1];
    return _chained_ec_op_inner(p=r, m=&m[1], q=&q[1], len=len - 1);
}

// Recovers the y coordinate of a point on the EC.
//
// Arguments:
//   x - the x coordinate of an EC point.
//
// Returns:
//   p - one of the two EC points with the given x coordinate (x, y).
//
// Assumptions:
//   There exists y such that (x, y) is on the curve. Otherwise the function's hint will throw a
//   python exception.
//
// Note:
//   This function will fail on x = 0 because there is no such point on the curve. The point at
//   infinity is represented as (0, 0), but this is just a representation, not actual coordinates.
func recover_y(x: felt) -> (p: EcPoint) {
    alloc_locals;
    local p: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import recover_y
        ids.p.x = ids.x
        # This raises an exception if `x` is not on the curve.
        ids.p.y = recover_y(ids.x, ALPHA, BETA, FIELD_PRIME)
    %}
    assert p.x = x;
    assert_on_curve(p);
    return (p=p);
}

// Checks if `x` represents the x coordinate of a point on the curve.
//
// Arguments:
//   x - a field element.
//
// Returns:
//   res - TRUE if `x` represents the x coordinate of a point on the curve, FALSE otherwise.
// Note:
//   Returns FALSE on x = 0 because there is no such point on the curve. The point at
//   infinity is represented as (0, 0), but this is just a representation, not actual coordinates.
func is_x_on_curve(x: felt) -> felt {
    return is_quad_residue(x=x * x * x + StarkCurve.ALPHA * x + StarkCurve.BETA);
}

// Represents a point on an elliptic curve.
struct EcPoint {
    x: felt,
    y: felt,
}

from starkware.cairo.common.cairo_builtins import HashBuiltin

// Computes a hash chain of a sequence whose length is given at [data_ptr] and the data starts at
// data_ptr + 1. The hash is calculated backwards (from the highest memory address to the lowest).
// For example, for the 3-element sequence [x, y, z] the hash is:
//   h(3, h(x, h(y, z)))
// If data_length = 0, the function does not return (takes more than field prime steps).
func hash_chain{hash_ptr: HashBuiltin*}(data_ptr: felt*) -> (hash: felt) {
    struct LoopLocals {
        data_ptr: felt*,
        hash_ptr: HashBuiltin*,
        cur_hash: felt,
    }

    tempvar data_length = [data_ptr];
    tempvar data_ptr_end = data_ptr + data_length;
    // Prepare the loop_frame for the first iteration of the hash_loop.
    tempvar loop_frame = LoopLocals(
        data_ptr=data_ptr_end, hash_ptr=hash_ptr, cur_hash=[data_ptr_end]
    );

    hash_loop:
    let curr_frame = cast(ap - LoopLocals.SIZE, LoopLocals*);
    let current_hash: HashBuiltin* = curr_frame.hash_ptr;

    tempvar new_data = [curr_frame.data_ptr - 1];

    let n_elements_to_hash = [ap];
    // Assign current_hash inputs and allocate space for n_elements_to_hash.
    current_hash.x = new_data, ap++;
    current_hash.y = curr_frame.cur_hash;

    // Set the frame for the next loop iteration (going backwards).
    tempvar next_frame = LoopLocals(
        data_ptr=curr_frame.data_ptr - 1,
        hash_ptr=curr_frame.hash_ptr + HashBuiltin.SIZE,
        cur_hash=current_hash.result,
    );

    // Update n_elements_to_hash and loop accordingly. Note that the hash is calculated backwards.
    n_elements_to_hash = next_frame.data_ptr - data_ptr;
    jmp hash_loop if n_elements_to_hash != 0;

    // Set the hash_ptr implicit argument and return the result.
    let hash_ptr = next_frame.hash_ptr;
    return (hash=next_frame.cur_hash);
}

// Represents a Poseidon state.
struct PoseidonBuiltinState {
    s0: felt,
    s1: felt,
    s2: felt,
}

from starkware.cairo.lang.compiler.lib.registers import get_ap, get_fp_and_pc

// Takes the value of a label (relative to program base) and returns the actual runtime address of
// that label in the memory.
//
// Usage example:
//
// func do_callback(...) {
